import './App.css';
import Button from 'react-bootstrap/Button';
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="App">
      <h1>KickBuddy</h1>
      <Button className="button">This is a button</Button>
    </div>
  );
}

export default App;
